create table sprint_info
(
    sprint_id        bigint       not null
        primary key,
    description      varchar(255) null,
    end_at           datetime(6)  null,
    fee              int          null,
    goal             varchar(255) null,
    sprint_img       varchar(255) null,
    penalty_money    int          null,
    routine_end_at   time         null,
    routine_start_at time         null,
    sprint_score     int          null,
    start_at         datetime(6)  null,
    constraint FKh4le0hi2yt55r8mffg44mykht
        foreign key (sprint_id) references sprint (sprint_id)
);

